button {

    text-transform: uppercase;
    font-weight: bold;
    letter-spacing: 0.1ch;

    cursor: pointer;
    background:

    transition: background-size 0.24s;
    touch-action: none;
    position:absolute;
    padding: 1rem 2rem;

}

button::before {
    content: "";
    position: absolute;
    inset: 0;

}

    background-clip: text;
    color: transparent;
    height: 100%;
    width: 100%;
    z-index: 2;
    position: relative;
    inset: 0;
}

:root:has(button:active) {
    --size: 300px;
}

button::after {
    content: "";
    position: absolute;
    inset: -4px;
    filter: blur(20px);
    border: 4px solid transparent;
    background: var(--glow);
    border-radius: 1rem;
			
			}

}

.controls {
    position: fixed;
    top: 2rem;
    right: 2rem;
}
